import React from 'react'

const Axios=()=>{
    return(
        <>
            <h1>hello guys</h1>
            <select>
                <option>1</option>
                <option>25</option>
                <option>3</option>
                <option>4</option>
                <option>5</option>
            </select>
        </>
    )
}

export default Axios;
